import React, { Component } from "react";
import axios from "axios";

class Index extends Component {
  constructor(props) {
    super(props);
  }
  static async getInitialProps() {
    const res = await axios.get("https://jsonplaceholder.typicode.com/posts");
    const { data } = res;
    return { posts: data };
  }

  render() {
    return (
      <div>
        <h1>Our Index Page</h1>
      </div>
    );
  }
}

